import React from "react";
import "./UploadSong.css";

class UploadSong extends React.Component {
  render() {
    return (
      <div className="">
        {/* <UploadFunctionality /> */}
        <div style={this.uploadFunctionalityStyle}>
          <div style={this.iconStyle}>
            <UploadIcon />
          </div>
          <div style={this.uploadText}>Upload New Song</div>
          <div style={this.fileFormatStyle}>
            <span>file format supported: mp3</span>
          </div>
        </div>
      </div>
    );
  }
}

export default UploadSong;
